CREATE OR REPLACE FUNCTION public.recalcul_statistiques_par_pays() RETURNS trigger
LANGUAGE plpgsql
AS $$
DECLARE
  v_idpays integer;
BEGIN
  IF TG_OP = 'DELETE' THEN
    v_idpays = OLD.idpays;
  ELSE
    v_idpays = NEW.idpays;
  END IF;

  UPDATE statistiques_par_pays
  SET
    total_cases = COALESCE((SELECT SUM(totalcas) FROM statistiques_quotidiennes WHERE idpays = v_idpays), 0),
    total_deaths = COALESCE((SELECT SUM(totaldeces) FROM statistiques_quotidiennes WHERE idpays = v_idpays), 0),
    total_recoveries = COALESCE((SELECT SUM(totalrecuperes) FROM statistiques_quotidiennes WHERE idpays = v_idpays), 0),
    total_active_cases = COALESCE((SELECT SUM(casactifs) FROM statistiques_quotidiennes WHERE idpays = v_idpays), 0)
  WHERE id = v_idpays;

  RETURN NULL; 
END;
$$;



